import './App.css';
import Home from './components/Home';

function App() {
  const instructionsForScan = [
    {id: '1', text: 'Open the camera app on your smartphone.'},
    {id: '2', text: 'Point the camera at the QR code.'},
    {id: '3', text: 'Wait for the camera to recognize the QR code.'},
    {id: '4', text: 'Tap on the notification or follow on-screen instructions to open the link.'},
  ];

  return (
    <Home />
  );
}

export default App;
